import { Injectable } from "@angular/core";
import { Observable } from "rxjs";

@Injectable({
  providedIn: "root",
})
export class LoginService {
  constructor() {}

  public createUSer(user: User): Observable<void> {
    return this.http.post<void>(this.piBaseUrl, user);
  }
}
